import React from "react";

const CardDetalle = ({ personaje }) => {
  console.log(personaje);
  return (
    <div className="container p-0 card mb-3 max-width-800px">
      <div className="row g-0">
        <div className="col-md-3">
          <img
            src={personaje.image}
            className="img-fluid rounded-start"
            alt="..."
          />
        </div>
        <div className="col-md-8 d-flex ">
          <div className="card-body">
            <h5 className="card-title">{personaje.name}</h5>
            <div className="d-flex">
              <p className="m-0">Genero: </p>
              <p className="m-0">{personaje.gender}</p>
            </div>
            <div className="d-flex">
              <p className="m-0">Origen:</p>{" "}
              <p className="m-0">{personaje.origin.name}:</p>
            </div>
          </div>
        </div>
        <div className="col-md-1">
          <div className="d-flex justify-content-end">
            <p className="m-4">hola</p>
          </div>
        </div>
      </div>
    </div>
  );
};

export default CardDetalle;
